select bar.name, bar.address from bar,
(select serves.bar from serves where serves.beer = 'Corona' and serves.price <=3) as T
where T.bar = bar.name;

SELECT name, address 
	FROM bar INNER JOIN serves ON (bar.name = serves.bar) 
	WHERE beer = 'Corona' AND price <= 3.00;

select bar.name, bar.address
from bar, (select bar from serves where beer='Corona' and price <= 3.00) as foo
where foo.bar = bar.name;

select name, address
from bar as b, serves as s
where b.name=s.bar and s.beer='Corona' and s.price <=3.00;

SELECT name, address 
	FROM serves, bar
	WHERE (serves.bar = bar.name AND beer = 'Corona' AND price <= 3.00);

SELECT DISTINCT bar.name, bar.address
FROM bar, serves
WHERE serves.beer = 'Corona' AND serves.price <= 3.0 AND bar.name = serves.bar;

Select distinct Bar.name, Bar.address
From Bar, Serves
Where Bar.name = Serves.bar and Serves.beer='Corona' and Serves.price <= 3.0;

SELECT name, address 
FROM bar, serves 
WHERE (bar.name = serves.bar AND serves.beer = 'Corona' AND serves.price <= 3);

SELECT DISTINCT name, address 
FROM Bar, Serves 
WHERE Bar.name = Serves.bar AND beer = 'Corona' AND price <= 3.00 ; 


/*(c) Find the names and addresses of bars that serve Corona for no more than $3.00.*/

select name, address
from bar join serves on name = bar
where beer = 'Corona' AND price <= 3.00;

SELECT q1.name, q1.address FROM (
(select bar, beer, price from serves where beer = 'Corona' and price <= 3.00) q0 LEFT JOIN
(SELECT name, address from bar) q1 ON q0.bar = q1.name);

SELECT name, address
FROM Serves, bar
WHERE bar = name AND beer = 'Corona' AND price <= 3;

/* Find the names and addresses of bars that serve Corona for no more than $3.00. */

SELECT name, address
FROM bar, serves
